import React from 'react';
import './footer.css';

import { Container, Row, Col, ListGroup, ListGroupItem } from 'reactstrap';
import { Link } from 'react-router-dom';
import logo from '../../assets/images/logo.png';


const quick__links =[
  {
    path: '/gallery',
    display: 'Gallery'
  },
  {
    path: '/login',
    display: 'Login'
  },
  {
    path: '/register',
    display: 'Register'
  },
]



const quick__links2 =[
  {
    path: '/home',
    display: 'Home'
  },
  {
    path: '/about',
    display: 'About'
  },
  {
    path: '/tours',
    display: 'Tours'
  },
]



const Footer = () => {
  return (
    <footer className='footer'>
      <Container>
        <Row>
          <Col lg='3'>
            <div className="logo">
              <img src={logo} alt="" />
              <p>
                Lorem, ipsum dolor sit amet consectetur adipisicing elit. Blanditiis, labore!
              </p>

              <div className="social__links d-flex align-items-center g-4">
                <span>
                  <Link to={'#'}><i class="ri-youtube-line"></i></Link>
                </span>

                <span>
                  <Link to={'#'}><i class="ri-instagram-line"></i></Link>
                </span>

                <span>
                  <Link to={'#'}><i class="ri-facebook-box-line"></i></Link>
                </span>
    
              </div>
            </div>
          </Col>

          <Col lg='' >
            <h5 className="footer__link-title">
              <ListGroup className='footer__quick-links'>
                {
                  quick__links.map((item, index) => (
                    <ListGroupItem>
                      <Link to={item.path}>{item.display}</Link>
                    </ListGroupItem>
                  ))
                }
                
              </ListGroup>
            </h5>
          </Col>
          <Col lg='' ></Col>
          <Col lg='' ></Col>
        </Row>
      </Container>

    </footer>
  )
}

export default Footer
